import React from "react";
import { Navbar, Nav, NavDropdown } from "react-bootstrap";
import { Link } from "react-router-dom";
import { useAuth } from "../context/auth";

function Navigation(props) {
    const { authTokens } = useAuth();
    const StyledLink = styled(Link)
    `text-decoration: none;
    color: white;
    &:focus, &:hover, &:visited, &:link, &:active {
        text-decoration: none;
    }
`;

    return (
        <Navbar bg="primary" variant="dark" expand="md">
            <Navbar.Brand to="/">Barnwood Site</Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            {authTokens ? (
                <Navbar.Collapse id="basic-navbar-nav">
                    <Nav className="mr-auto">
                        <NavDropdown title="Products" id="basic-nav-dropdown">
                            <NavDropdown.Item to="/products">Admin: Product List</NavDropdown.Item>
                            <NavDropdown.Divider />
                            <NavDropdown.Item to="/products/new">Admin: Create Product</NavDropdown.Item>
                        </NavDropdown>
                        <StyledLink to="/users">Admin: User List</StyledLink>
                        <StyledLink to="/contact">Contact Us</StyledLink>
                    </Nav>
                    <Nav>
                        <StyledLink to="/logout">Log Out</StyledLink>
                    </Nav>
                </Navbar.Collapse>
            ) : (
                <Navbar.Collapse id="basic-navbar-nav">
                    <Nav className="mr-auto">
                        <StyledLink to="/products">Admin: Product List</StyledLink>
                        <StyledLink to="/contact">Contact Us</StyledLink>
                    </Nav>
                    <Nav>
                        <StyledLink to="/register">Register</StyledLink>
                        <StyledLink to="/login">Login</StyledLink>
                    </Nav>
                </Navbar.Collapse>
            )}
        </Navbar>
    )
}

export default Navigation;
